import React from 'react';
import logo from './logo.svg';
import './App.css';
import Greet from "./components/Greet";
import Welcome from "./components/welcome";

function App() {
  return (
    <div className="App">
    <Greet name="Pratim"/>
    <Greet name="Sarkar"/>
    <Greet name="ead"/>
    <Welcome name="asf"/>
    </div>
  );
}
export default App;
